import React from 'react'
import { Route,Routes } from 'react-router-dom'
import Frontend from './Frontend'
export default function comRoutes() {
  return (
    <>
   <Routes>
    <Route path='/*' element={<Frontend/>}/> 
    </Routes> 
    </>
  )
}
